import { Image } from "@chakra-ui/image";
import { Box, Flex, Heading, Text } from "@chakra-ui/layout";

import { Button } from "@chakra-ui/button";

export default function Home() {
  
  return (
    <Box height="100%">
      <Box position="relative" m="0 auto" maxW="1367px">
        <Flex justifyContent="space-around" p="0 20px">
        <Box 
          backgroundColor="red" 
          boxShadow="0px 1px 4px rgba(0, 0, 0, 0.15)" 
          width="570px"
          height="550px" 
          borderRadius="15px" 
          mt="40px"
          justifyContent="space-around"
        >
          <Image  borderRadius="full" boxSize="100px" src="https://bit.ly/sage-adebayo" alt="Segun Adebayo" />
         
        </Box>
        </Flex>
      </Box>
    </Box>
  );
}
